import { Component, OnInit } from '@angular/core';
import { HttpClient } from '@angular/common/http';
import { Router } from '@angular/router';
import { LocalStorageService } from '../../services/local-storage-service.service';
import { CategoriesService } from 'src/app/services/categories.service';

interface Card {
  id: number;
  name: string;
  image: string;
  // Add other properties as needed
}

@Component({
  selector: 'app-card-list',
  templateUrl: './category-list.component.html',
  styleUrls: ['./category-list.component.css']
})
export class CardListComponent implements OnInit {
categories: any[] = [];

  constructor(private dataService: CategoriesService, private http: HttpClient, private localStorageService: LocalStorageService, private router: Router) {}


  onCardClick(card: any) {
    this.router.navigate(['/category', card.id]);

  }


  onClearLocalStorageClick() {
    this.localStorageService.clearStoredCards();
  }

  ngOnInit(): void {
    this.fetchData();
  }



  fetchData(): void {
    this.dataService.getData().subscribe(
      (data) => {
        this.categories = data;
        console.log('Categories from service :', this.categories);

      },
      (error) => {
        console.error('Error fetching data from service:', error);
      }
    );
  }


}
